        from: totalDataPoints - visibleRange,
        to: totalDataPoints - 1,
        });
        chart.applyOptions({
                    layout: {
                        fontFamily: "'Saira Condensed', sans-serif",
                    },
                });
        chart.applyOptions({
    watermark: {
        visible: true,
        fontSize: 40,
        horzAlign: 'center',
        vertAlign: 'center',
        color: 'rgba(148, 152, 161, 0.3)',
        text: 'LMT',
        fontFamily: "'Saira Condensed', sans-serif",
    },
});
                 
    </script>
